import logo from './logo.svg';
import './App.css';

function App() {

  const logo = "https://img.freepik.com/free-vector/image-upload-concept-landing-page_23-2148309692.jpg?w=996&t=st=1713546488~exp=1713547088~hmac=6123329a6bf6afd550b0c81c8381122315fab4c314a20de2adeb5bed397de7f8"
  return (

      <img src={logo} alt="banner"/>

  );
}

export default App;
